    # Disable insecure warnings
    urllib3.disable_warnings()

    def get_random_image_url(size):
        url = f'https://picsum.photos/{size}'
        res = requests.get(url, verify=False)
        if res.status_code != 200:
            raise ValueError(f'Missing "{arg_name}"')

        return res.url


    def genarate_random_image(args: Dict[str, Any]) -> CommandResults:
        size = args.get('size', "700")
        url = get_random_image_url(size)

        return {
            "ContentsFormat": 'markdown',
            "Type": 1,
            "Contents": f'![Random Image]({url})'
        }

    def test_module() -> str:
        get_random_image_url("200")
        return 'ok'


    def main() -> None:
        try:
            if demisto.command() == 'test-module':
                # This is the call made when pressing the integration Test button.
                result = test_module()
                return_results(result)
            elif demisto.command() == 'genarate-random-image':
                return_results(genarate_random_image(demisto.args()))
        # Log exceptions and return errors
        except Exception as e:
            demisto.error(traceback.format_exc())  # print the traceback
            return_error(f'Failed to execute {demisto.command()} command.\nError:\n{str(e)}')


    if __name__ in ('__main__', '__builtin__', 'builtins'):
        main()
